import logo from './logo.svg';
import tvJude from './TV Jude.png'
import tvJudeFond from './TV Jude cheveux derier.png'
import usbDown from './usb down.png'
import usbUp from './usb UP.png'
import './App.css';

function App() {
  const styleUsb = {width: '8%', position: 'fixed', top: '40vw', left: '75%'}

  return (
    <div style={{backgroundColor: 'black', height: '100vh', display: 'flex', justifyContent: 'center'}}>
      <img style={{width: '90%', position: 'fixed'}} src={tvJudeFond}></img>
      <img style={{}} src={usbDown}></img>
      <img style={{width: '8%', position: 'fixed', top: '40vw', left: '75%'}} src={usbUp}></img>
      <img style={{width: '90%', position: 'fixed'}} src={tvJude}></img>
    </div>
  );
}

export default App;
